import styled from "styled-components";

import React, { Component } from 'react';

export default styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 450px;
  width: 100%;
  background-color: rgba(0, 0, 0, 0.5);
  color: #fff;
  margin: 0 15px;
  font-size: 1.5rem;
  border-radius:30px;
`;
